import Header from "../groups/Header";

export default function Top(props) {
  const handleSuccessfulAuthentication = (userdata) => {
    props.history.push("/dashboard")
  }

  return (
    <div>
      <Header handleSuccessfulAuthentication={handleSuccessfulAuthentication}/>
      <h1>Top</h1>
      <h2>ログイン状態: {props.loggedInStatus}</h2>
    </div>
  );
}
